import React from "react";
import { Link } from "react-router-dom";

import Avatar from "../../shared/Avatar";

function Logo() {
  var logoMomo =
    "https://www.cmontmorency.qc.ca/wp-content/themes/axial/images/logo.png";

  return (
    <React.Fragment>
      <Link to={`/accueil`}>
        <img src={logoMomo} alt="logo Montmorency" />
      </Link>
    </React.Fragment>
  );
}

export default Logo;
